{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Tidyverse\n\n![image.png](attachment:9d306063-9d35-4507-98f2-7360cad045ce.png)\n\n[tidyverse](https://www.tidyverse.org) in R, one of the Important packages in R, there are a lot of new techniques available maybe users are not aware of.\n\nIn this live code-along session, you'll learn the basic principles of analyzing your data using R and the tidyverse. You'll code along to explore the `nycflights13` dataset and discover how you can use packages (i.e. sets of tools for doing stuff with data) in the tidyverse to get from data to insight as intuitively and efficiently as possible. But seriously: if you want to filter your data, you use the verb (or function) `filter`; if you wish to arrange it in a particular order, you use `arrange`. The tidyverse set of tools is a revolution that consists of computational tools that intuitively mirror how we all think about data.\n\nIn this session, we will use Kaggle Notebook and Tidyverse to explore the [`NYC Flights 2013`](https://cran.r-project.org/web/packages/nycflights13/) dataset, which consists of observations of all flights that departed NYC in 2013. The data frame contains all 336,776 flights and the data comes from the US Bureau of Transportation Statistics, and is documented in `?flights`.","metadata":{},"attachments":{"9d306063-9d35-4507-98f2-7360cad045ce.png":{"image/png":""}}},{"cell_type":"markdown","source":"There are five key `dplyr` functions that allow you to solve the vast majority of your data manipulation challenges:\n\n- Pick observations by their values (`filter()`).\n- Reorder the rows (`arrange()`).\n- Pick variables by their names (`select()`).\n- Create new variables with functions of existing variables (`mutate()`).\n- Collapse many values down to a single summary (`summarise()`).\n\nThese can all be used in conjunction with `group_by()` which changes the scope of each function from operating on the entire dataset to operating on it group-by-group. These six functions provide the verbs for a language of data manipulation.\n\n","metadata":{}},{"cell_type":"markdown","source":"## Installation\n\n- Install [R](https://cran.r-project.org/mirrors.html) from here.\n- Install [RStudio](https://www.rstudio.com/products/rstudio/download/) from here.\n- Follow kuanhoong's github repo [here](https://github.com/kuanhoong/tidyverse) to test your set-up (note: it is not necessary to establish communication between Kaggle and Github for this session).\n- Install all the packages in the tidyverse by running `install.packages(\"tidyverse\")` in Kaggle notebook.","metadata":{}},{"cell_type":"code","source":"install.packages(\"tidyverse\")\ninstall.packages(\"lubridate\")\ninstall.packages(\"nycflights13\")\nlibrary(tidyverse)\nlibrary(lubridate)\nlibrary(nycflights13)","metadata":{"execution":{"iopub.status.busy":"2022-05-05T13:59:20.148732Z","iopub.execute_input":"2022-05-05T13:59:20.150748Z","iopub.status.idle":"2022-05-05T14:00:33.221260Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n\n\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.6     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.8\n\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstri