.status.idle":"2022-05-05T12:44:40.207895Z"}},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Summarizing and grouping your data\n\nUse the `summarise()` verb to group and summarise data.","metadata":{}},{"cell_type":"code","source":"# Check out mean air_time\n\nflights %>%\nsummarise(mean_air_time = mean (air_time, na.rm=TRUE), n=n())\n\n","metadata":{"execution":{"iopub.status.busy":"2022-05-05T10:32:15.19185Z","iopub.execute_input":"2022-05-05T10:32:15.193656Z","iopub.status.idle":"2022-05-05T10:32:15.224946Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"You can also use the `filter()` and `summarise()` verbs to find out the mean `air_time` for flights from `JFK` to `LAX`","metadata":{}},{"cell_type":"code","source":"flights %>%\nfilter (origin == \"JFK\" & dest == \"LAX\") %>%\nsummarise (mean_air_time = mean(air_time, na.rm = TRUE))","metadata":{"execution":{"iopub.status.busy":"2022-05-05T10:45:05.907651Z","iopub.execute_input":"2022-05-05T10:45:05.909462Z","iopub.status.idle":"2022-05-05T10:45:05.962517Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## `group_by()`\n`summarise()` is not terribly useful unless we pair it with `group_by()`\n\nUse the `group_by()` and `summarise()` verbs to find the mean `air_time` and `tailnum` as a function for all flights from `JFK` to `LAX`","metadata":{}},{"cell_type":"code","source":"flights %>%\nfilter (origin == \"JFK\" & dest == \"LAX\") %>%\ngroup_by (tailnum) %>%\nsummarise (mean_air_time = mean(air_time, na.rm = TRUE), n=n())","metadata":{"execution":{"iopub.status.busy":"2022-05-05T10:44:22.047317Z","iopub.execute_input":"2022-05-05T10:44:22.0492Z","iopub.status.idle":"2022-05-05T10:44:22.162507Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## `count()`\n\nWhenever you do any aggregation, it’s always a good idea to include either a `count (n())`, or a count of no