w column basis group by\n\nYou can create group by summary based on below script.","metadata":{}},{"cell_type":"code","source":"flights %>%\n  group_by(date = make_date(year, month, day)) %>%\n  summarise(flights_n = n(), air_time_mean = mean(air_time, na.rm = TRUE)) %>%\n  ungroup()","metadata":{"execution":{"iopub.status.busy":"2022-05-05T08:11:53.45417Z","iopub.execute_input":"2022-05-05T08:11:53.455776Z","iopub.status.idle":"2022-05-05T08:11:53.562316Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Randomly Shuffle the data\n\nSuppose you want to randomly slice the data with 15 rows, can execute the same basis below command.","metadata":{}},{"cell_type":"code","source":"flights %>%\n  slice_sample(n = 15)\n","metadata":{"execution":{"iopub.status.busy":"2022-05-05T08:13:06.394729Z","iopub.execute_input":"2022-05-05T08:13:06.396392Z","iopub.status.idle":"2022-05-05T08:13:06.442446Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Using prop command also you can slice the data set.","metadata":{}},{"cell_type":"code","source":"flights %>%\n  slice_sample(prop = 0.15)","metadata":{"execution":{"iopub.status.busy":"2022-05-05T08:13:35.264063Z","iopub.execute_input":"2022-05-05T08:13:35.265568Z","iopub.status.idle":"2022-05-05T08:13:35.445559Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Date column creation\n\nIn the original data set year, month and date contained as separate columns-based make_date command can create new date column.","metadata":{}},{"cell_type":"code","source":"flights %>%\n  select(year, month, day) %>%\n  mutate(date = make_date(year, month, day))","metadata":{"execution":{"iopub.status.busy":"2022-05-05T08:14:05.897863Z","iopub.execute_input":"2022-05-05T08:14:05.899493Z","iopub.status.idle":"2022-05-05T08:14:05.981834Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Number Parsing\n\nSuppose you want extract only numbers then you can you parse_number option.","metadata":{}},{"cell_type":"code","source":"numbers_1 <- tibble(number = c(\"#1\", \"Number8\", \"How are you 3\"))\nnumbers_1 %>% mutate(number = parse_number(number))","metadata":{"execution":{"iopub.status.busy":"2022-05-05T08:14:56.721235Z","iopub.execute_input":"2022-05-05T08:14:56.722846Z","iopub.status.idle":"2022-05-05T08:14:56.79837Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Select columns with starts_with and ends_with\n\nYou can select the columns based on start_with and end_with option, here is the example","metadata":{}},{"cell_type":"code","source":"flights %>%\n  select(starts_with(\"dep_\"))\nflights %>%\n  select(ends_with(\"hour\"))\nflights %>%\n  select(contains(\"hour\"))","metadata":{"execution":{"iopub.status.busy":"2022-05-05T08:15:38.762988Z","iopub.execute_input":"2022-05-05T08:15:38.764601Z","iopub.status.idle":"2022-05-05T08:15:38.902829Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## case_when to create when conditions are met\n\nCreate a new columns when conditions are met. case_when is one of the handy tool for conditions identification.","metadata":{}},{"cell_type":"code","source":"flights %>%\n  mutate(origin = case_when(\n    (origin == \"EWR\") & dep_delay > 20 ~ \"Newark International Airport - DELAYED\",\n    (origin == \"EWR\") & dep_delay <= 20 ~ \"Newark International Airport - ON TIME DEPARTURE\",\n  )) %>%\n  count(origin)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## str_replace_all to find and replace multiple options at once\n\nEvery one aware about str_replace in string r pacakage, here we can execute replace multiple options at a once.","metadata":{}},{"cell_type":"code","source":"flights %>%\n  mutate(origin = str_replace_all(origin, c(\n    \"^EWR$\" = \"Newark International\",    \"^JFK$\" = \"John F. Kennedy International\"\n  ))) %>%\n  count(origin)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Filter groups without making a new column\n\nFiltering is one of the essential function for cleaning and checking data sets.","metadata":{}},{"cell_type":"code","source":"flights_top_carriers <- flights %>%\n  group_by(carrier) %>%\n  filter(n() >= 10000) %>%\n  ungroup()","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Extract rows from the first table which are matched in the second table\n\nYou can extract the row information’s based on str_detect function","metadata":{}},{"cell_type":"code","source":"beginning_with_am<- airlines %>%   \nfilter(name %>% str_detect(\"^Am\")) ","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Extract rows from the first table which are not matched in the second table\n\nSame way you can remove row information’s from the data frame while using anti_join function","metadata":{}},{"cell_type":"code","source":"flights %>%\n  anti_join(airways_beginning_with_a, by = \"carrier\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Resources\n\n- [Tidyverse](https://www.tidyverse.org/) - R Packages for Data Science\n- [R for Data Science](https://r4ds.had.co.nz/) - Hadley Wickham & Garrett Grolemund\n- [Getting Started with the Tidyverse: Tutorial](https://www.datacamp.com/tutorial/tidyverse-tutorial-r)\n- [Manipulating, analyzing and exporting data with tidyverse](https://datacarpentry.org/R-ecology-lesson/03-dplyr.html)\n- [Intoduction to Tidyverse](https://www.pkimes.com/PR2019replicathon/tutorials/0b_R_tidyverse.html)","metadata":{}},{"cell_type":"markdown","source":"# About Me\n\n## Poo Kuan Hoong, Ph.D\nConnect with me:\n- [Twitter](https://twitter.com/kuanhoong)\n- [LinkedIn](https://www.linkedin.com/in/kuanhoong/)\n- [GitHub](https://github.com/kuanhoong/)","metadata":{}}]}